function Url(props) {
  const domain = props.url && new URL(props.url).hostname;
  return (
    <span className="inline-block text-[75%] text-grey-n">
      &nbsp;(
      <a href={props.url} className=" hover:underline">
        {domain ? domain:"www.g.com"}
      </a>
      )
    </span>
  );
}

export default Url;
